#ifndef ASPOSE_CELLS_CHARTS_TICKLABELPOSITIONTYPE_H
#define ASPOSE_CELLS_CHARTS_TICKLABELPOSITIONTYPE_H

namespace Aspose { namespace Cells { namespace Charts {

/// <summary>
/// Represents the position type of tick-mark labels on the specified axis.
/// </summary>
enum class TickLabelPositionType {
    /// <summary>
    /// Position type is high.
    /// </summary>
    High,
    /// <summary>
    /// Position type is low.
    /// </summary>
    Low,
    /// <summary>
    /// Position type is next to axis.
    /// </summary>
    NextToAxis,
    /// <summary>
    /// Position type is none.
    /// </summary>
    None,
};

} } }

#endif
